import { useState, useEffect } from "react";
import axios from "axios";
import { toast } from "react-toastify";
import { useNavigate } from "react-router-dom";
import "./getUser.css"


const GetAllUsers = () => {
  const [allUsers, setAllUser] = useState([]);
  const navigate = useNavigate();

  // console.log("it is state")
  useEffect(() => {
    getUser()
  }, [])
  const getUser = () => 
 
  {
    axios
      .get("http://localhost:8080/parkifyAdmin/getUserByRole/USER")
      .then((response) => {
        const result = response.data;
        //console.log("result")
        console.log(result);
        // console.log(typeof(result))
        //if (result['status'] == 'success') {
        if (result != null) {
          console.log(result);
          
          toast.success('success')
          setAllUser(result.data);
        } else {
          toast.error(result["error"]);
        }

        
      });
      
  };

 


  return (

    <div>
      <div className="square">
      <h1 style={styles.h1} >User List</h1>
      </div>
      

      <div>
        <table className="table" background-color="white">
        
          <thead>
            <tr>
              <th>UserID</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email Id</th>
              <th>Mobile No</th>
              
            </tr>
          </thead>
          <tbody>
            
            {allUsers.map((allUser) => {
              
              return (
                
               <tr>
                  <td>{allUser.userId}</td>
                  <td>{allUser.firstName}</td>
                  <td>{allUser.lastName}</td>
                  <td>{allUser.email}</td>
                  <td>{allUser.mobileNo}</td>
                 
                </tr>
               
              ) 
            
            })}
          </tbody>
        </table>
      </div>
      <div><button
          style={styles.button}
          onClick={() => {
            navigate("/admin");
          }}
          className="btn btn-primary"
        >
          Back
        </button></div>
    </div>
  )
 
}
const styles = {
  h1: {
    textAlign: 'center',
    margin: 20,
    color: 'white',
  },
  button: {
    marginLeft: 10,
  },
}
export default GetAllUsers;
